import React from 'react';
// import NavBer from '../components/NavBar';
import ReactDOM from 'react-dom/client';
import { Routes, Route } from 'react-router-dom';
import './LandingPage.css'


const LandingPage = () => {
    return (
        <div className="landing-container">
            <div className="icon-wrapper">
            <img src="/assets/landingpage-1.png" alt="아이콘1" />
            <img src="/assets/landingpage-2.png" alt="아이콘2" />
            <img src="/assets/landingpage-3.png" alt="아이콘3" />
            <img src="/assets/landingpage-4.png" alt="아이콘4" />
            <img src="/assets/landingpage-5.png" alt="아이콘5" />
            </div>


            <button className="start-button">
            <img src="/assets/start-icon.png" alt="시작 아이콘" />
            <span>시작하기</span>
            </button>
        </div>
    )
}

export default LandingPage;
